INSERT INTO `loginfo` (`LoginDate`, `Name`, `Activity`, `ActionDate`, `Username`, `LogOutDate`, `Operation`, `LogID`, `remote_ip`, `remote_host`, `id`) VALUES ('2022-12-16 16:00:23', 'vocettt@outlook.com', 'Request for listing was successfully.Details are: Issuer Id = 7; Email = vocettt@outlook.com; Artist = Avocet Technologica; Artwork Id = 32; Artwork Title = Laguardia; Creation Date = 2022; Dimensions = Artwork Dimension; Materials Used For Artwork = On each end of Mayor street we find a church. On one side is the church of San Juan, a Romanesque building that also incorporates several other architectural styles, and on the other, the church of Santa Mara de los Reyes. The latter has an impressive Gothic main front, one of the few from that period that still preserves the original polychromy. In one of the ends of the walled enclosure, in \\\"El Collado\\\" boulevard, we see the monument dedicated to fabulist Samaniego, who was born in this city. It is a great idea to take a walk around Laguardia, since the whole city centre constitutes an interesting historic and artistic site. As we walk we should stop in any of its numerous cellars to taste or buy some of the magnificent local wines.\\r\\nNear the urban centre of Laguardia we find the Dolmen of San Martn, and the Town of La Hoya, whose remains date back to the first millennium before Christ. We can also approach the nature park of \\\"Las Lagunas\\\", declared a protected biotype.; Description = Laguardia is the most important town in La Rioja of Alava, and one of the most beautiful. The region is famous all around the world because of its wines, and because it was the birthplace of fabulist Samaniego.\\r\\n\\r\\nLa Rioja of Alava has a perfect climate for farming the wines that give this area its well-deserved fame. It is also an area with numerous archaeological sites, Paleolithic remains, as well as Roman and medieval artefacts.\\r\\nThe whole urban centre of Laguardia is enclosed by walls, built at the beginning of the 13th century.; Document Filename = ; Display Location = All; Artwork Value = 5000; No Of Tokens = 100; Price Per Token = 50; Artwork Picture 1 Filename = 32_pix1.jpg; Artwork Picture 2 Filename = 32_pix2.jpg; Artwork Picture 3 Filename = 32_pix3.jpg; Artwork Picture 4 Filename = 32_pix4.jpg; Listing Status = Awaiting Approval; Request Date = 2022-12-16 16:00:22', '2022-12-16 16:00:23', 'vocettt@outlook.com', NULL, 'MADE REQUEST FOR ARTWORK LISTING', '639c828c4545a', '197.210.53.34', '197.210.53.34', '1160');
