INSERT INTO `loginfo` (`LoginDate`, `Name`, `Activity`, `ActionDate`, `Username`, `LogOutDate`, `Operation`, `LogID`, `remote_ip`, `remote_host`, `id`) VALUES ('2023-01-12 10:04:30', 'Samuel John', 'Listing request record has been edited successfully by SAMUEL JOHN(VOCETTT@OUTLOOK.COM). Old Values => Issuer Id = 7; Email = vocettt@outlook.com; Artist = Samuel John; Artwork Id = 33; Artwork Title = His Dark Materials; Symbol = ; Creation Date = 2019; Dimensions = Artwork Dimension; Materials Used For Artwork = ; Description = ; Document Filename = ; Display Location = Abuja; Artwork Value = 100000.00; No Of Tokens = 100; No Of Tokens For Sale = 100; Price Per Token = 100.00; Artwork Picture 1 Filename = 33_pix1.jpg; Artwork Picture 2 Filename = 33_pix2.jpg; Artwork Picture 3 Filename = ; Artwork Picture 4 Filename = ; Listing Status = Awaiting Approval; Request Date = 2023-01-12 09:19:33; Listing Start Date = ; Listing End date = ; Approval Date = . Updated values => Issuer Id = 7; Email = vocettt@outlook.com; Artist = Samuel John; Artwork Id = 33; Artwork Title = His Dark Materials; Symbol = ; Creation Date = 2019; Dimensions = Artwork Dimension; Materials Used For Artwork = &lt;ul&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Dafne Keen&quot; href=&quot;https://en.wikipedia.org/wiki/Dafne_Keen&quot;&gt;Dafne Keen&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;Lyra Belacqua&quot; href=&quot;https://en.wikipedia.org/wiki/Lyra_Belacqua&quot;&gt;Lyra Belacqua&lt;/a&gt;&amp;nbsp;(later known as Lyra Silvertongue), a girl who was raised at&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Jordan College, Oxford&quot; href=&quot;https://en.wikipedia.org/wiki/Jordan_College,_Oxford&quot;&gt;Jordan College&lt;/a&gt;.&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Amir Wilson&quot; href=&quot;https://en.wikipedia.org/wiki/Amir_Wilson&quot;&gt;Amir Wilson&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;Will Parry (His Dark Materials)&quot; href=&quot;https://en.wikipedia.org/wiki/Will_Parry_(His_Dark_Materials)&quot;&gt;Will Parry&lt;/a&gt;,&lt;sup id=&quot;cite_ref-Will_3-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-Will-3&quot;&gt;[2]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;a secondary school student from&amp;nbsp;&lt;a title=&quot;Oxford&quot; href=&quot;https://en.wikipedia.org/wiki/Oxford&quot;&gt;Oxford&lt;/a&gt;, whose father disappeared 13 years previously.&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Ruth Wilson&quot; href=&quot;https://en.wikipedia.org/wiki/Ruth_Wilson&quot;&gt;Ruth Wilson&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;Marisa Coulter&quot; href=&quot;https://en.wikipedia.org/wiki/Marisa_Coulter&quot;&gt;Marisa Coulter&lt;/a&gt;, a powerful figure at the Magisterium who is Lyra\\\'s mother.&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Anne-Marie Duff&quot; href=&quot;https://en.wikipedia.org/wiki/Anne-Marie_Duff&quot;&gt;Anne-Marie Duff&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;List of His Dark Materials and The Book of Dust characters&quot; href=&quot;https://en.wikipedia.org/wiki/List_of_His_Dark_Materials_and_The_Book_of_Dust_characters#Ma_Costa&quot;&gt;Maggie &quot;Ma&quot; Costa&lt;/a&gt;, a Gyptian woman who previously nursed Lyra. (series 1)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Clarke Peters&quot; href=&quot;https://en.wikipedia.org/wiki/Clarke_Peters&quot;&gt;Clarke Peters&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;List of His Dark Materials and The Book of Dust characters&quot; href=&quot;https://en.wikipedia.org/wiki/List_of_His_Dark_Materials_and_The_Book_of_Dust_characters#The_Master_of_Jordan_College&quot;&gt;The Master of Jordan College&lt;/a&gt;. (series 1)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;James Cosmo&quot; href=&quot;https://en.wikipedia.org/wiki/James_Cosmo&quot;&gt;James Cosmo&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Farder Coram&quot; href=&quot;https://en.wikipedia.org/wiki/Farder_Coram&quot;&gt;Farder Coram van Texel&lt;/a&gt;, an elderly Gyptian and Serafina\\\'s former lover. (series 1)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Ariyon Bakare&quot; href=&quot;https://en.wikipedia.org/wiki/Ariyon_Bakare&quot;&gt;Ariyon Bakare&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Lord Boreal&quot; href=&quot;https://en.wikipedia.org/wiki/Lord_Boreal&quot;&gt;Lord Carlo Boreal&lt;/a&gt;,&lt;sup id=&quot;cite_ref-Press_4-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-Press-4&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;an authoritative figure at the Magisterium who crosses between two worlds. In Will\\\'s world, he is known as Sir Charles Latrom. (series 1&amp;ndash;2)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Will Keen&quot; href=&quot;https://en.wikipedia.org/wiki/Will_Keen&quot;&gt;Will Keen&lt;/a&gt;&amp;nbsp;as Father Hugh MacPhail (later Cardinal and Father President), a Magisterium official.&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Lucian Msamati&quot; href=&quot;https://en.wikipedia.org/wiki/Lucian_Msamati&quot;&gt;Lucian Msamati&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;List of His Dark Materials and The Book of Dust characters&quot; href=&quot;https://en.wikipedia.org/wiki/List_of_His_Dark_Materials_and_The_Book_of_Dust_characters#John_Faa&quot;&gt;Lord John Faa&lt;/a&gt;, of the Western Gyptians. (series 1)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Gary Lewis (actor)&quot; href=&quot;https://en.wikipedia.org/wiki/Gary_Lewis_(actor)&quot;&gt;Gary Lewis&lt;/a&gt;&amp;nbsp;as Thorold,&lt;sup id=&quot;cite_ref-Press_4-1&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-Press-4&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;Asriel\\\'s assistant. (series 1&amp;ndash;2)&lt;/li&gt;\\r\\n&lt;li&gt;Lewin Lloyd as&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Roger Parslow&quot; href=&quot;https://en.wikipedia.org/wiki/Roger_Parslow&quot;&gt;Roger Parslow&lt;/a&gt;, a kitchen boy who is Lyra\\\'s best friend. (series 1 and 3; guest series 2)&lt;/li&gt;\\r\\n&lt;li&gt;Daniel Frogson as Tony Costa, Ma Costa\\\'s elder son. (series 1)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Lin-Manuel Miranda&quot; href=&quot;https://en.wikipedia.org/wiki/Lin-Manuel_Miranda&quot;&gt;Lin-Manuel Miranda&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Lee Scoresby&quot; href=&quot;https://en.wikipedia.org/wiki/Lee_Scoresby&quot;&gt;Lee Scoresby&lt;/a&gt;, an aeronaut. (series 1&amp;ndash;2; featured series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Ruta Gedmintas&quot; href=&quot;https://en.wikipedia.org/wiki/Ruta_Gedmintas&quot;&gt;Ruta Gedmintas&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Serafina Pekkala&quot; href=&quot;https://en.wikipedia.org/wiki/Serafina_Pekkala&quot;&gt;Serafina Pekkala&lt;/a&gt;, a witch who is the Queen of the Lake Enara witches, and Coram\\\'s former lover.&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Nina Sosanya&quot; href=&quot;https://en.wikipedia.org/wiki/Nina_Sosanya&quot;&gt;Nina Sosanya&lt;/a&gt;&amp;nbsp;as Elaine Parry,&lt;sup id=&quot;cite_ref-S1E5_5-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-S1E5-5&quot;&gt;[4]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;Will\\\'s sick mother. (series 1; featured series 2; guest series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Jade Anouka&quot; href=&quot;https://en.wikipedia.org/wiki/Jade_Anouka&quot;&gt;Jade Anouka&lt;/a&gt;&amp;nbsp;as Ruta Skadi,&lt;sup id=&quot;cite_ref-6&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-6&quot;&gt;[5]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;a witch queen and a former lover of Lord Asriel. (series 2&amp;ndash;3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Sean Gilder&quot; href=&quot;https://en.wikipedia.org/wiki/Sean_Gilder&quot;&gt;Sean Gilder&lt;/a&gt;&amp;nbsp;as Father Graves, a member of the Magisterium. (series 2)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Simone Kirby&quot; href=&quot;https://en.wikipedia.org/wiki/Simone_Kirby&quot;&gt;Simone Kirby&lt;/a&gt;&amp;nbsp;as Dr Mary Malone, a physicist from Will\\\'s world. (series 2&amp;ndash;3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Andrew Scott (actor)&quot; href=&quot;https://en.wikipedia.org/wiki/Andrew_Scott_(actor)&quot;&gt;Andrew Scott&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;List of His Dark Materials and The Book of Dust characters&quot; href=&quot;https://en.wikipedia.org/wiki/List_of_His_Dark_Materials_and_The_Book_of_Dust_characters#John_Parry&quot;&gt;Colonel John Parry&lt;/a&gt;,&lt;sup id=&quot;cite_ref-Jopari_7-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-Jopari-7&quot;&gt;[6]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;a marine and explorer who is Will\\\'s father. In Lyra\\\'s world, he is known as a shaman named Stanislaus Grumman. (series 2; featured series 3; guest series 1)&lt;sup id=&quot;cite_ref-S2E3_8-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-S2E3-8&quot;&gt;[7]&lt;/a&gt;&lt;/sup&gt;&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Adewale Akinnuoye-Agbaje&quot; href=&quot;https://en.wikipedia.org/wiki/Adewale_Akinnuoye-Agbaje&quot;&gt;Adewale Akinnuoye-Agbaje&lt;/a&gt;&amp;nbsp;as Ogunwe, a resistance fighter who Lord Asriel recruits. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Jonathan Aris&quot; href=&quot;https://en.wikipedia.org/wiki/Jonathan_Aris&quot;&gt;Jonathan Aris&lt;/a&gt;&amp;nbsp;as Commander Roke, an inches-tall Gallivespian who works as Lord Asriel\\\'s spy. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Chipo Chung&quot; href=&quot;https://en.wikipedia.org/wiki/Chipo_Chung&quot;&gt;Chipo Chung&lt;/a&gt;&amp;nbsp;as Xaphania, an angel allied with Lord Asriel. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Kobna Holdbrook-Smith&quot; href=&quot;https://en.wikipedia.org/wiki/Kobna_Holdbrook-Smith&quot;&gt;Kobna Holdbrook-Smith&lt;/a&gt;&amp;nbsp;as Balthamos, an angel who seeks Will to recruit him to Lord Asriel\\\'s cause. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;Jamie Ward as Father Gomez, a member of the Magisterium. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;James McAvoy&quot; href=&quot;https://en.wikipedia.org/wiki/James_McAvoy&quot;&gt;James McAvoy&lt;/a&gt;&amp;nbsp;as&amp;nbsp;&lt;a title=&quot;Lord Asriel&quot; href=&quot;https://en.wikipedia.org/wiki/Lord_Asriel&quot;&gt;Lord Asriel Belacqua&lt;/a&gt;,&lt;sup id=&quot;cite_ref-9&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-9&quot;&gt;[8]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;a scholar and explorer who is Lyra\\\'s father, and leads the resistance against the Authority. (series 3; featured series 1; guest series 2)&lt;sup id=&quot;cite_ref-S3Renewal_10-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials_(TV_series)#cite_note-S3Renewal-10&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt;&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Sian Clifford&quot; href=&quot;https://en.wikipedia.org/wiki/Sian_Clifford&quot;&gt;Sian Clifford&lt;/a&gt;&amp;nbsp;as Agent Salmakia, a Gallivespian spy. (series 3)&lt;/li&gt;\\r\\n&lt;li&gt;&lt;a title=&quot;Alex Hassell&quot; href=&quot;https://en.wikipedia.org/wiki/Alex_Hassell&quot;&gt;Alex Hassell&lt;/a&gt;&amp;nbsp;as Metatron, the Authority\\\'s regent. (series 3)&lt;/li&gt;\\r\\n&lt;/ul&gt;; Description = &lt;p&gt;&lt;em&gt;&lt;strong&gt;His Dark Materials&lt;/strong&gt;&lt;/em&gt;&amp;nbsp;is a&amp;nbsp;&lt;a title=&quot;Trilogy&quot; href=&quot;https://en.wikipedia.org/wiki/Trilogy&quot;&gt;trilogy&lt;/a&gt;&amp;nbsp;of&amp;nbsp;&lt;a title=&quot;Fantasy literature&quot; href=&quot;https://en.wikipedia.org/wiki/Fantasy_literature&quot;&gt;fantasy novels&lt;/a&gt;&amp;nbsp;by&amp;nbsp;&lt;a title=&quot;Philip Pullman&quot; href=&quot;https://en.wikipedia.org/wiki/Philip_Pullman&quot;&gt;Philip Pullman&lt;/a&gt;&amp;nbsp;consisting of&amp;nbsp;&lt;em&gt;&lt;a title=&quot;Northern Lights (Pullman novel)&quot; href=&quot;https://en.wikipedia.org/wiki/Northern_Lights_(Pullman_novel)&quot;&gt;Northern Lights&lt;/a&gt;&lt;/em&gt;&amp;nbsp;(1995; published as&amp;nbsp;&lt;em&gt;The Golden Compass&lt;/em&gt;&amp;nbsp;in North America),&amp;nbsp;&lt;em&gt;&lt;a title=&quot;The Subtle Knife&quot; href=&quot;https://en.wikipedia.org/wiki/The_Subtle_Knife&quot;&gt;The Subtle Knife&lt;/a&gt;&lt;/em&gt;&amp;nbsp;(1997), and&amp;nbsp;&lt;em&gt;&lt;a title=&quot;The Amber Spyglass&quot; href=&quot;https://en.wikipedia.org/wiki/The_Amber_Spyglass&quot;&gt;The Amber Spyglass&lt;/a&gt;&lt;/em&gt;&amp;nbsp;(2000). It follows the&amp;nbsp;&lt;a title=&quot;Coming of age&quot; href=&quot;https://en.wikipedia.org/wiki/Coming_of_age&quot;&gt;coming of age&lt;/a&gt;&amp;nbsp;of two children,&amp;nbsp;&lt;a title=&quot;Lyra Belacqua&quot; href=&quot;https://en.wikipedia.org/wiki/Lyra_Belacqua&quot;&gt;Lyra Belacqua&lt;/a&gt;&amp;nbsp;and&amp;nbsp;&lt;a title=&quot;Will Parry (His Dark Materials)&quot; href=&quot;https://en.wikipedia.org/wiki/Will_Parry_(His_Dark_Materials)&quot;&gt;Will Parry&lt;/a&gt;, as they wander through a series of&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; title=&quot;Parallel universe (fiction)&quot; href=&quot;https://en.wikipedia.org/wiki/Parallel_universe_(fiction)&quot;&gt;parallel universes&lt;/a&gt;. The novels have won a number of awards, including the&amp;nbsp;&lt;a title=&quot;Carnegie Medal (literary award)&quot; href=&quot;https://en.wikipedia.org/wiki/Carnegie_Medal_(literary_award)&quot;&gt;Carnegie Medal&lt;/a&gt;&amp;nbsp;in 1995 for&amp;nbsp;&lt;em&gt;Northern Lights&lt;/em&gt;&amp;nbsp;and the 2001&amp;nbsp;&lt;a title=&quot;Costa Book Awards&quot; href=&quot;https://en.wikipedia.org/wiki/Costa_Book_Awards&quot;&gt;Whitbread Book of the Year&lt;/a&gt;&amp;nbsp;for&amp;nbsp;&lt;em&gt;The Amber Spyglass&lt;/em&gt;. In 2003, the trilogy was ranked third on the&amp;nbsp;&lt;a title=&quot;BBC&quot; href=&quot;https://en.wikipedia.org/wiki/BBC&quot;&gt;BBC&lt;/a&gt;\\\'s&amp;nbsp;&lt;a title=&quot;The Big Read&quot; href=&quot;https://en.wikipedia.org/wiki/The_Big_Read&quot;&gt;The Big Read&lt;/a&gt;&amp;nbsp;poll.&lt;sup id=&quot;cite_ref-Big_Read_1-0&quot; class=&quot;reference&quot;&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/His_Dark_Materials#cite_note-Big_Read-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;; Document Filename = ; Display Location = Abuja; Artwork Value = 100000.00; No Of Tokens = 100; No Of Tokens For Sale = 100; Price Per Token = 100.00; Artwork Picture 1 Filename = 33_pix1.jpg; Artwork Picture 2 Filename = 33_pix2.jpg; Artwork Picture 3 Filename = ; Artwork Picture 4 Filename = ; Listing Status = Awaiting Approval; Request Date = 2023-01-12 09:19:33; Listing Start Date = ; Listing End date = ; Approval Date = ', '2023-01-12 10:04:30', 'vocettt@outlook.com', NULL, 'EDITED LISTING REQUEST RECORD', '63bfc73a88907', '102.91.4.36', '102.91.4.36', '1376');
