#
# TABLE STRUCTURE FOR: trade_log
#

DROP TABLE IF EXISTS `trade_log`;

CREATE TABLE `trade_log` (
  `logdate` datetime DEFAULT NULL,
  `activity` text CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `username` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `fullname` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `operation` varchar(50) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `remote_ip` varchar(30) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `remote_host` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11529 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: loginfo
#

DROP TABLE IF EXISTS `loginfo`;

CREATE TABLE `loginfo` (
  `LoginDate` datetime DEFAULT NULL,
  `Name` varchar(150) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `Activity` text CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `ActionDate` datetime DEFAULT NULL,
  `Username` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `LogOutDate` datetime DEFAULT NULL,
  `Operation` varchar(50) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `LogID` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `remote_ip` varchar(30) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `remote_host` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1473 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



